using System;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Builder;
using Microsoft.AspNetCore.Hosting;
using Microsoft.Extensions.Configuration;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Hosting;
using Quartz;
using Quartz.Impl;

namespace Quartzmin.Test
{
    public class Startup
    {
        public Startup(IWebHostEnvironment env)
        {
            var builder = new ConfigurationBuilder()
                .SetBasePath(env.ContentRootPath)
                .AddJsonFile("appsettings.json", optional: true, reloadOnChange: true)
                .AddEnvironmentVariables();
            builder.Build();
        }

        // This method gets called by the runtime. Use this method to add services to the container.
        public void ConfigureServices(IServiceCollection services)
        {
            //services.AddSingleton(StdSchedulerFactory.GetDefaultScheduler().Result);
            //1.register jobs middleware.
            //services.AddQuartzJob();
            //2.create web page from scheduler.
            services.AddScoped<TestJob>();
            services.AddQuartzmin();
        }

        // This method gets called by the runtime. Use this method to configure the HTTP request pipeline.
        public void Configure(IApplicationBuilder app, IWebHostEnvironment env)
        {
            if (env.IsDevelopment())
            {
                app.UseDeveloperExceptionPage();
            }

            var scheduler = StdSchedulerFactory.GetDefaultScheduler().Result;
            app.UseQuartzmin(new QuartzminOptions
            {
                Scheduler = scheduler,
                ProductName = "SOC Scheduler",
                VirtualPathRoot = "",
                Logo =
                    "data:image/png;base64,"
            });
        }

